<section class="page-section features">
    <div class="container">
        <div class="row">
             <header class="col-xs-12 text-center" style="margin-bottom: 60px;">
                <h4 class="page-section-tag">Features</h4>
                <h2 class="page-section-heading">For a contact database that’s clean, optimized, and secure</h2>
            </header>
        </div>

        <div class="row">
            <div class="col-md-6">

                <h3 class="page-section-heading">Lookup <span class="pill pill-purple">Free service</span>
                <p class="lp">Our free-to-use Lookup service provides basic number insights to help you keep your contact numbers organized. Validate numbers and formats, eliminate fraudulent contacts, and reduce your undeliverable messages by ridding your recipient lists of inactive numbers.</p>

            </h3></div>
            <div class="col-md-6">
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-format.svg" width="20">
                <h4 class="features-label">Number format</h4>
                <p class="sp">Verify that your numbers are formatted correctly and adjust entry errors to ensure your messages get delivered. Filter out numbers that are too long, to short, or contain unsupported characters. Our service applies known standards such as national formats and E.164 to keep your contact lists compliant and up to date.</p>

                <pre class="small-code-example line-numbers"><code class="language-bash">"formats": {
    "e164": "+31642657439",
    "international": "+31 6 42657439",
    "national": "06 42657439",
    "rfc3966": "tel:+31-6-42657439"
}</code></pre>
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-numberinfo.svg" width="20">
                <h4 class="features-label">Number info</h4>
                <p class="sp">Classify numbers as mobile, landline or SIP.</p>

                <pre class="small-code-example line-numbers"><code class="language-bash">"type": "mobile"</code></pre>
            </div>

        </div>

        <hr>

        <div class="row">
            <div class="col-md-6">
                <h3 class="page-section-heading">Lookup + HLR <span class="pill pill-purple">Paid service</span>
                <p class="lp">Through MessageBird’s direct connection to the <abbr title="Signalling System No. 7">SS7</abbr> network, we’re able to send an <abbr title="Send Routing Info">SRI</abbr> request to receive information from the <abbr title="Home Location Register">HLR</abbr> network regarding any currently active number in the world.</p>
            </h3></div>
            <div class="col-md-6">
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-mcc.svg" width="20">
               <h4 class="features-label"> <abbr title="Mobile Country Code">MCC</abbr> &amp; <abbr title="Mobile Network Code">MNC</abbr></h4>
               <p class="sp">Identify a number’s country of origin as well as the mobile network to which it’s registered.</p>
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-imsi.svg" width="20">
               <h4 class="features-label"> Location <abbr title="International Mobile Subscriber Identity">IMSI</abbr></h4>
               <p class="sp">Discover any given number’s current geolocation.</p>
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-validity.svg" width="20">
               <h4 class="features-label"> Number Validity</h4>
               <p class="sp">Establish whether a number is active, deactivated, or unregistered.</p>

                <pre class="small-code-example line-numbers"><code class="language-bash">"status": "active"</code></pre>
                <img class="features-icon" src="https://cdn-gc.messagebird.com/assets/assets-images/icons/500/20pt24box/mb-icon-lookup-msc.svg" width="20">
                <h4 class="features-label"> <abbr title="Mobile Switching Center">MSC</abbr></h4>
                <p class="sp">Determine whether a subscriber is roaming, in which country they are roaming, and on which network they are currently registered.</p>

                <pre class="small-code-example line-numbers"><code class="language-bash">"location_msc": "316530"</code></pre>

            </div>

        </div>

    </div>
</section>


<section class="page-section" id="pdf">
